import React from 'react';
import { PostDetailsStyled } from 'react-router-dom';

const PostDetails = ({
  title,
  description,
  imageUrl,
  content,
  postId,
}) => {
  return (
    <PostDetailsStyled>
        <img src={imageUrl} alt={title} />
        <h3>Titre: {title}</h3>
        <div>Description: {description}</div>
    </PostDetailsStyled>
  )
};

export { PostDetails };
